import React from 'react';
import { Link as L } from 'react-router-dom';
import Logout from '../user/Logout';
import { useState } from 'react';

const Header = ({token}) => {
    const [endToken, setEndToken] = useState(token);

    const handleLogout = (endToken) => setEndToken(endToken);
    return(
        <nav className="navbar navbar-dark bg-primary fixed-top">
            <L className="navbar-brand" to="/">
                Q&Aqq
            </L>
            <div>
              {token ? 
              (
                <Logout token={token} onClick={handleLogout} />
              )
               : 
              (<>
                <L className="navbar-brand" to="/signup">
                    Sign Up
                </L>
                <L className="navbar-brand" to="/login">
                    Log in
                </L>
                </>
              )
              }
            </div>
        </nav>
    )
}

export default Header;
